// Code: Main App component
import './App.css';
import Header from './Header/Header';
import Main from './Main/Main';
import Sidebar from './Sidebar/Sidebar';

function App() {
  return (
    <div className="App">
      <Header />
      <Main />
      <Sidebar />
    </div>
  );
}

export default App;
